  dbr:Reardon_Manor geo:hasGeometry/geo:asWKT ?manorGeom .

  BIND(geof:distance(?manorGeom, ?questGeom) AS ?distance)

  {
    SELECT (MAX(?dist) AS ?maxDistance) WHERE {
      ?q a witcher:SideQuest ;
         geo:hasGeometry/geo:asWKT ?qGeom .
      dbr:Reardon_Manor geo:hasGeometry/geo:asWKT ?mGeom .
      BIND(geof:distance(?mGeom, ?qGeom) AS ?dist)
