  ?sideQuest a witcher:The_Witcher_3_secondary_quests ;
             rdfs:label ?sideQuestLabel ;
             geo:hasGeometry ?sideQuestGeom .
  ?sideQuestGeom geo:asWKT ?sideQuestWKT .

  # Calculate distance
  BIND(geof:distance(?raceWKT, ?sideQuestWKT) AS ?distance)

  # Find the maximum distance
  {
    SELECT (MAX(?dist) AS ?maxDistance) WHERE {
      dbr:Race_The_Great_Erasmus_Vegelbud_Memorial_Derby geo:hasGeometry ?raceGeom2 .
      ?raceGeom2 geo:asWKT ?raceWKT2 .
      ?sideQuest2 a witcher:The_Witcher_3_secondary_quests ;
                 geo:hasGeometry ?sideQuestGeom2 .
      ?sideQuestGeom2 geo:asWKT ?sideQuestWKT2 .
      BIND(geof:distance(?raceWKT2, ?sideQuestWKT2) AS ?dist)
    }
  }

  FILTER(?distance = ?maxDistance)
}

