               rdfs:label ?gwentPlayerName ;
               geo:hasGeometry/geo:asWKT ?playerLocation .

  # Calculate distance between race location and each Gwent player
  BIND(geof:distance(?raceLocation, ?playerLocation) AS ?distance)
}
ORDER BY DESC(?distance)

SELECT ?stakeLabel ?distance WHERE {
  # Get Lurtch's geometry
  dbr:Lurtch geo:hasGeometry ?lurtchGeo .
  ?lurtchGeo geo:asWKT ?lurtchWKT .

  # Get all signaling stakes
  ?stake a witcher:SignalingStake ;
         rdfs:label ?stakeLabel ;
         geo:hasGeometry ?stakeGeo .
  ?stakeGeo geo:asWKT ?stakeWKT .

  # Calculate distance from Lurtch
  BIND(geof:distance(?lurtchWKT, ?stakeWKT) AS ?distance)

  # Find the maximum distance
  {
    SELECT (MAX(?dist) AS ?maxDistance) WHERE {
      dbr:Lurtch geo:hasGeometry ?lGeo .
      ?lGeo geo:asWKT ?lWKT .
      ?s a witcher:SignalingStake ;
         geo:hasGeometry ?sGeo .
      ?sGeo geo:asWKT ?sWKT .
      BIND(geof:distance(?lWKT, ?sWKT) AS ?dist)
    }
  }

  # Filter to only the stake with maximum distance
  FILTER(?distance = ?maxDistance)
}

SELECT ?stake ?stakeLabel ?distance WHERE {
  # Get Yantra's geometry
  dbr:Yantra geo:hasGeometry ?yantraGeo .
  ?yantraGeo geo:asWKT ?yantraGeom .

  # Get all Signaling Stakes and their geometries
  ?stake a witcher:SignalingStake ;
         rdfs:label ?stakeLabel ;
         geo:hasGeometry ?stakeGeometry .
  ?stakeGeometry geo:asWKT ?stakeGeom .

  # Calculate distance
  BIND(geof:distance(?yantraGeom, ?stakeGeom) AS ?distance)
}
ORDER BY ?distance

